import React, { Component } from "react";
import contactArray from "./../contacts.json";

import "./Filter1.css";

class Filter1 extends Component {
  state = {
    dataFilter: contactArray
  };

  render() {
    return (
      <section>
        <h1>H</h1>
      </section>
    );
  }
}

export default Filter1;
